import React from "react";

export default function Card(props) {
  return (
    <div className="card">
      <div className="card-image">
          <div className="card-descriptor">
            <div className="card-name">Deadlift</div>
            <div className="card-muscles">Hip extensors</div>
        </div>
      </div>
    </div>
  )
}
